import React from "react";

const Education = () => {
  return (
    <section id="education">
      <h2>Formação Acadêmica</h2>
      <h3> Análise e Desenvolvimento de Sistemas, Instituto Federal de Rondônia, Campus Ji-Paraná — Nível Superior</h3>
      <p>Formação superior que estuda os diversos sistemas que envolvem hardware, software e interação com o usuário final, com o objetivo de encontrar a melhor abordagem racional para o processamento eficaz da informação.</p>
      <h3> Instituto Federal de Rondônia, Campus Ji-Paraná — Nível Médio</h3>
      <p>Formação técnica em informática adquiri um conhecimento abrangente em diversas áreas do campo da informática. As atividades incluíram desde a instalação e manutenção de computadores, criação de Bancos de Dados até desenvolver um software completo.</p>
    </section>
  );
};

export default Education;
